const nomeDuplicado = 'Cabo USB 001';
const {
  preco,
  descricao,
  quantidade
} = gerarDadosProduto();
// Primeiro cadastra o produto
productActions.cadastrarProduto(token, nomeDuplicado, preco, descricao, quantidade).then(() => {
  // Tenta cadastrar novamente o mesmo produto e valida o erro
  productActions.cadastrarProduto(token, nomeDuplicado, preco, descricao, quantidade).should(response => {
    expect(response.status).to.equal(400);
    expect(response.body.message).to.equal('Já existe produto com esse nome');
  });
});

const nome = `Produto para editar - ${Date.now()}`;
productActions.cadastrarProduto(token, nome, 10, 'Descrição original', 100).then(response => {
  const id = response.body._id;
  productActions.editarProduto(token, id, nome, 100, 'Descrição atualizada', 101).should(resEdit => {
    expect(resEdit.status).to.equal(200);
    expect(resEdit.body.message).to.equal('Registro alterado com sucesso');
  });
});

const nome = `Produto para deletar - ${Date.now()}`;
productActions.cadastrarProduto(token, nome, 50, 'delete', 20).then(response => {
  const id = response.body._id;
  productActions.deletarProduto(token, id).should(resDel => {
    expect(resDel.status).to.equal(200);
    expect(resDel.body.message).to.equal('Registro excluído com sucesso');
  });
});
